import React from 'react';
import Results from './ResultsComponent';
import Numbers from './NumbersComponent';
import Operators from './OperatorsComponent';
import './Display.css';

function CalculatorDisplay() {
  return (
    <div>
      <Results />
      <Numbers />
      <Operators />
    </div>
  );
}

export default CalculatorDisplay;
